import './App.css';


import React, { Component } from 'react'
import Navbar from './components/Navbar';
import News from './components/News';

import {  BrowserRouter as Router,  Routes,  Route} from "react-router-dom";


export default class App extends Component {
  name = "saket";
  render() {

    return (
      <div>
        <BroRouter>
        <Navbar/>
            <Routes>

              <Route exact path='/'><News pageSize = {5} category = "general" country="in" /></Route> 
              <Route exact path='/general'><News pageSize = {5} category = "general" country="in" /></Route>       
              <Route exact path='/business'><News pageSize = {5} category = "business" country="in" /> </Route>
              <Route exact path='/entertainment'><News pageSize = {5} category = "entertainment" country="in" /> </Route> 
              <Route exact path='/health'><News pageSize = {5} category = "health" country="in" /></Route>
              <Route exact path='/science'><News pageSize = {5} category = "science" country="in" /></Route>
              <Route exact path='/sports'><News pageSize = {5} category = "sports" country="in" /></Route>
              <Route exact path='/technology'><News pageSize = {5} category = "technology" country="in" /></Route>

            </Routes>
        </BroRouter>
      </div>
    )
  }
}
